import React from 'react';
import { useSelector, useDispatch } from 'react-redux';

function CoinList({ coins }) {
    console.log('coins',);
    const upbitCoinList = Object.keys(coins);

    return (
        <ul>
            {
                upbitCoinList.map(list => (
                    <li>
                        {list}
                    </li>
                ))
            }
        </ul>
    )
}

export default CoinList;
